const all = async ({ filters }) => {
    const { limit, page } = filters;
    const offset = limit * (page - 1);
    const filtered = await filter(filters);
    const data = filtered.slice(offset, offset + limit);
    const total = filtered.length;
    const pageCount = Math.ceil(total/limit);
    const meta = { pageCount, total, limit, currentPage:page};
    return { data, meta }
};
//JAVASCRIPT FILTER ONLY, IN SEQUALIZE CAN USE WHERE CLAUSE DIRECTLY
const filter = async(filters)=>{
    let data = todos.slice();
    for(const key of Object.keys(filters)){
        if(key === "limit" || key === "page") continue;
        const filter = filters[key];
        if(typeof filter === "object"){
            const f = Object.keys(filter);
            const value = filter[f];
            data = data.filter(x => ((x[key])[f])(value));
        }else{
            data = data.filter(x => x[key] === filter);
        }
    }
    return data;
}


module.exports = {
    all,
};
